def decimalToBinary(n,bits=7):
  zeros = [0 for _ in range(bits)]
  result = [int(digit) for digit in bin(n).replace("0b", "")]
  n = len(result)
  zeros[-n:] = result
  return zeros

def to_binary(kod):
  result = []
  for number in kod:
    result.extend(decimalToBinary(number))
  return result

