  sygnal = []
  funkcja = lambda t, A_n: A_n*sin(2*pi*f_n*t + phi_n)
  for n, b in zip(range(int(T*f_s)), sygnal_modulujacy):
    if b ==0:
      sygnal.append(funkcja(n/f_s, A_1))
    if b ==1:
      sygnal.append(funkcja(n/f_s, A_2))
  return sygnal

