def PSK(sygnal_modulujacy):
  sygnal = []
  funkcja = lambda t, phi_n: sin(2*pi*f_n*t + phi_n)
  for n, b in zip(range(int(T*f_s)), sygnal_modulujacy):
    if b ==0:
      phi_n = 0
      sygnal.append(funkcja(n/f_s, phi_n))
    if b ==1:
      phi_n = pi
      sygnal.append(funkcja(n/f_s, phi_n))
  return sygnal

